// SPDX-License-Identifier: MIT

pragma solidity >=0.6.12;
pragma experimental ABIEncoderV2;

import "../openzeppelin/contracts/math/SafeMath.sol";
import "../openzeppelin/contracts/access/Ownable.sol";
import "../interface/ICreator.sol";
import "../interface/ITeemoPool.sol";
import "../interface/ITeemoToken.sol";
import "../interface/IBonusRecord.sol";

contract PoolFactory is Ownable {
    using SafeMath for uint256;

    event AddPool(address indexed tokenAddr, address indexed poolAddr);
    event AddPoolModule(address indexed tokenAddr, address indexed poolAddr, address indexed createAddr);

    address public quoteFactoryAddr;
    address public teemoTokenAddr;
    address public teemoGovTokenAddr;
    address public bonusRecordAddr;
    address public devAddr;

    address[] public allPoolAddr;
    mapping(address => uint256) public allTokenIndex;//tokenaddr =>array index
    mapping(address => uint256) public allPoolIndex;// pooladdr  =>array index
    mapping(string => address) public allCreatorInfo;

    // false: test mode, true: production mode
    bool public projectStatus;

    constructor(
        address _devAddr,
        address _quoteFactoryAddr,
        address _teemoTokenAddr,
        address _teemoGovTokenAddr,
        string[] memory _creatorNames,
        address[] memory _creatorAddrs
    ) public {
        devAddr = _devAddr;
        quoteFactoryAddr = _quoteFactoryAddr;
        teemoTokenAddr = _teemoTokenAddr;
        teemoGovTokenAddr = _teemoGovTokenAddr;
        require(_creatorNames.length == _creatorAddrs.length, "creator info err");
        for(uint256 i=0;i<_creatorNames.length;i++){
            setCreatorInfo(_creatorNames[i],_creatorAddrs[i]);
        }
    }

    modifier onlyPool() {
        require(allPoolIndex[msg.sender] != 0, "Ownable: caller is not the pool");
        _;
    }

    function poolLength() public view returns(uint256) {
        return allPoolAddr.length;
    }

    function setQuoteFactoryAddr(address _quoteFactoryAddr) public onlyOwner {
        quoteFactoryAddr = _quoteFactoryAddr;
    }

    function setTeemoTokenAddr(address _teemoTokenAddr) public onlyOwner {
        teemoTokenAddr = _teemoTokenAddr;
    }

    function setTeemoGovTokenAddr(address _teemoGovTokenAddr) public onlyOwner {
        teemoGovTokenAddr = _teemoGovTokenAddr;
    }

    function setDevAddr(address _devAddr) public onlyOwner {
        devAddr = _devAddr;
    }

    function setCreatorInfo(string memory _creatorName,address _creatorAddr) public onlyOwner {
        allCreatorInfo[_creatorName] = _creatorAddr;
    }

    function addPool(address _tokenAddr, address _mainnetTokenAddr) public onlyOwner returns (address createAddr){
        require(allTokenIndex[_tokenAddr] == 0, "addPool: POOL_EXISTS");
        address creatorAddr = getCreatorAddr("POOL");
        createAddr = IPoolCreator(creatorAddr).createPool(_tokenAddr,_mainnetTokenAddr,address(this),quoteFactoryAddr);
        allPoolAddr.push(createAddr);
        allPoolIndex[createAddr] = allPoolAddr.length;
        allTokenIndex[_tokenAddr] = allPoolAddr.length;
        emit AddPool(_tokenAddr, createAddr);
    }

    function addWPool() public onlyOwner returns (address createAddr){
        require(allTokenIndex[address(0)] == 0, "addWPool: POOL_EXISTS");
        address creatorAddr = getCreatorAddr("WPOOL");
        createAddr = IWPoolCreator(creatorAddr).createPool(address(this),quoteFactoryAddr);
        allPoolAddr.push(createAddr);
        allPoolIndex[createAddr] = allPoolAddr.length;
        allTokenIndex[address(0)] = allPoolAddr.length;
        emit AddPool(address(0), createAddr);
    }

     function addPoolModule(string memory _creatorName,address _tokenAddr,uint256[] memory _args) public onlyOwner returns (address createAddr) {
        address poolAddr = getAddr(_tokenAddr);
        address creatorAddr = getCreatorAddr(_creatorName);
        createAddr = ICreator(creatorAddr).create(poolAddr,_tokenAddr,_args);
        ITeemoPool(poolAddr).setModuleAddr(_creatorName,createAddr);
        emit AddPoolModule(_tokenAddr, poolAddr, createAddr);
    }

    function mintToken(uint256 _mintAmount) public onlyPool {
        ITeemoToken(teemoTokenAddr).mint(devAddr, _mintAmount.div(10));
        ITeemoToken(teemoTokenAddr).mint(address(this), _mintAmount);
    }

    function safeTeemoTransfer(address _to, uint256 _amount) public onlyPool {
        uint256 teemoBal = ITeemoToken(teemoTokenAddr).balanceOf(address(this));
        if (_amount > teemoBal) {
            ITeemoToken(teemoTokenAddr).transfer(_to, teemoBal);
        } else {
            ITeemoToken(teemoTokenAddr).transfer(_to, _amount);
        }
    }

    function mintGovToken(address _userAddr, uint256 _mintAmount) public onlyPool {
        ITeemoToken(teemoGovTokenAddr).mint(_userAddr, _mintAmount);
    }

    function getAddr(address _tokenAddr) public view returns (address poolAddr){
        poolAddr = allPoolAddr[allTokenIndex[_tokenAddr].sub(1)];
        require(poolAddr != address(0), "getAddr: POOL_NOT_EXISTS");
    }
    function getCreatorAddr(string memory _creatorName) public view returns (address creatorAddr){
        creatorAddr = allCreatorInfo[_creatorName];
        require(creatorAddr != address(0), "getCreatorAddr: CREATOR_NOT_EXISTS");
    }

    function setBonusRecord(address _bonus) public onlyOwner {
        bonusRecordAddr = _bonus;
    }

    function updateBonus(address _user, uint256 _amount) public  onlyPool {
        require(bonusRecordAddr != address(0), "updateBonus: recorder not set");
        IBonusRecord(bonusRecordAddr).updateBonus(_user, _amount);
    }

    function mintBonus(address _user, uint256 _amount) public {
        require(msg.sender == bonusRecordAddr ,"mintBonus: caller is not the bonus recorder");
        ITeemoToken(teemoTokenAddr).mint(_user, _amount);
    }    

    function setStatus(bool _status) public onlyOwner {
        projectStatus = _status;
    }

    function getStatus() public view returns (bool status) {
        status = projectStatus;
    }

}
